import React from "react";
import ReactRoundedImage from "react-rounded-image";
import MyPhoto from "./ProfilePic.jpeg";
import styles from 'styled-componene'
function ProfilePicture() {
	const BeautifulButton = styled.button`
		color: #494949;
		text-transform: uppercase;
		text-decoration: none;
		background: #ffffff;
		padding: 20px;
		font-size: 20px;
		border: 4px solid #494949;
		display: inline-block;
		transition: all 0.4s ease 0s;
		&:hover {
			color: #ffffff;
			background: #f6b93b;
			border-color: #f6b93b;
			transition: all 0.4s ease 0s;
		}
	`;
	return (
		<div
			style={{
				paddingLeft: "100px",
				paddingTop: "30px",
				paddingBottom: "30px",
			}}
		>
			<ReactRoundedImage
				image={MyPhoto}
				roundedSize='0'
				imageWidth='200'
				imageHeight='200'
			/>
			<h5
				style={{
					paddingTop: "30px",
				}}
			>
				Borja Ingle-Fernandez
			</h5>
			<a
				style={{
					// paddingTop: "100px",
					backgroundColor: "red",
					padding: "padding: 1em 1.5em",
					"hover": {
						backgroundColor: "yellow",
					},
				}}
				href='mailto: borja.ingle@gmail.com'
			>
				borja.ingle@gmail.com
			</a>
		</div>
	);
}

function NameDescription() {
	return (
		<div
			style={{
				paddingLeft: "100px",
				paddingRight: "100px",
				paddingTop: "100px",
			}}
		>
			<i>
				{" "}
				Lorem Ipsum is simply dummy text of the printing and typesetting
				industry. Lorem Ipsum has been the industry's standard dummy text ever
				since the 1500s, when an unknown printer took a galley of type and
				scrambled it to make a type specimen book. It has survived not only five
				centuries, but also the leap into electronic typesetting, remaining
				essentially unchanged. It was popularised in the 1960s with the release
				of Letraset sheets containing Lorem Ipsum passages, and more recently
				with desktop publishing software like Aldus PageMaker including versions
				of Lorem Ipsum.
			</i>
		</div>
	);
}

function HomePage() {
	return (
		<div
			style={{
				paddingTop: "20px",
			}}
		>
			<div
				className='Introduction'
				style={{
					display: "flex",
					justifyContent: "center",
					// border: "1px solid black",
					width: "80%",
					margin: "auto",
				}}
			>
				<ProfilePicture />
				<NameDescription />
			</div>
		</div>
	);
}

export default HomePage;
